    "LTI Configuration using reusable configuration needs a external ID in \"x:y\" format.": "\u0c2a\u0c41\u0c28\u0c30\u0c4d\u0c35\u0c3f\u0c28\u0c3f\u0c2f\u0c4b\u0c17 \u0c15\u0c3e\u0c28\u0c4d\u0c2b\u0c3f\u0c17\u0c30\u0c47\u0c37\u0c28\u0c4d\u200c\u0c28\u0c3f \u0c09\u0c2a\u0c2f\u0c4b\u0c17\u0c3f\u0c02\u0c1a\u0c47 LTI \u0c15\u0c3e\u0c28\u0c4d\u0c2b\u0c3f\u0c17\u0c30\u0c47\u0c37\u0c28\u0c4d\u200c\u0c15\u0c41 &quot;x:y&quot; \u0c06\u0c15\u0c43\u0c24\u0c3f\u0c32\u0c4b \u0c2c\u0c3e\u0c39\u0c4d\u0c2f ID \u0c05\u0c35\u0c38\u0c30\u0c02.",
